import React from 'react';

export default function Experiences() {
  const experience = {
    title: "Software Engineer – Smart Desert Pvt Ltd | Bengaluru",
    period: "May 2022 – Aug 2024",
    points: [
      "Built a social media platform using the MERN stack (MongoDB, Express.js, React, Node.js), with a focus on scalable architecture and real-time user experience.",
      "Integrated Stripe APIs for direct customer transactions and automated the order system, reducing processing time by 20%. Oversaw SDLC phases using Jira.",
      "Collaborated across teams to ensure data quality (SQL), system efficiency (Python scripts), and version control using Git and VS Code. Led design reviews and ensured compliance with local regulations."
    ]
  };

  return (
    <section className="experiences">
      <h2>My Experiences</h2>
      <div className="timeline-card">
        <h3>{experience.title}</h3>
        <p><strong>{experience.period}</strong></p>
        <ul>
          {experience.points.map((point, idx) => (
            <li key={idx}>{point}</li>
          ))}
        </ul>
      </div>
    </section>
  );
}
